import React from 'react'
import Logo  from '../images/emotions.png'
const Navbar = () => {
  return (
    <>
     <Nav>
        <NavbarContainer>
            <NavLogo>
                <img src={Logo}/>
            </NavLogo>
        </NavbarContainer>
     </Nav>
    </>
  );
}

export default Navbar
